    import {  storeFfundRecordInfoApi, staffListInfo } from '@/api/store';
    import { mapState } from 'vuex';
    export default {
        name: 'commissionDetails',
        data () {
            return {
				grid: {
				    xl: 7,
				    lg: 7,
				    md: 12,
				    sm: 24,
				    xs: 24
				},
                modals: false,
                detailsData: {},
                Ids: 0,
                loading: false,
				staff: [],
				ids: '',
               formValidate: {
				 ids: '',
                 store_id: '',
                 keyword: "",
                 data: "",
                 page: 1,
                 limit: 10,
               },
                total: 0,
                columns: [
                    {
                    	title: '交易单号',
                    	key: 'order_id',
                    	minWidth: 80
                    },
                    {
                    	title: '关联订单',
                    	key: 'link_id',
                    	minWidth: 80
                    },
                    {
                    	title: '交易时间',
                    	key: 'trade_time',
                    	minWidth: 150
                    },
                    {
                    	title: '交易金额',
                    	slot: 'number',
                    	minWidth: 80
                    },
                    {
                    	title: '交易人',
                    	key: 'user_nickname',
                    	ellipsis: true,  
                    	minWidth: 80
                    },
                    {
                    	title: '关联店员',
                    	key: 'staff_name',
                    	minWidth: 80
                    },
                    {
                        title: '交易类型',
                        key: 'type_name',
                        minWidth: 80
                    },
                    {
                        title: '支付方式',
                        key: 'pay_type_name',
                        minWidth: 80
                    },
                    {
                    	title: '备注',
                    	key: 'remark',
                    	minWidth: 120
                    }
                ],
                tabList: []

            }
        },
        computed: {
            ...mapState('admin/layout', [
                'isMobile'
            ]),
            labelWidth () {
                return this.isMobile ? undefined : 80;
            },
            labelPosition () {
                return this.isMobile ? 'top' : 'left';
            }
        },
        mounted () {
			this.staffApi()
        },
        methods: {
			staffApi(){
				staffListInfo().then(res=>{
					this.staff = res.data
				})
			},
			searchs(){
				this.formValidate.page = 1
				this.getList(this.ids)
			},
            // 时间
            onchangeTime (e) {
                this.formValidate.start_time = e[0];
                this.formValidate.end_time = e[1];
            },
            // 列表
            getList (id) {
				this.ids = id
				this.formValidate.ids = id
                this.loading = true;
                storeFfundRecordInfoApi(this.formValidate).then(async res => {
                    let data = res.data;
                    this.tabList = data.list;
                    this.total = data.count;
                    this.loading = false;
                }).catch(res => {
                    this.loading = false;
                    this.$Message.error(res.msg);
                })
            },
            pageChange (index) {
                this.formValidate.page = index
                this.getList(this.ids);
            },
			reset(){
				this.formValidate = {
					ids: this.ids,
				  store_id: '',
				  keyword: "",
				  data: "",
				  page: 1,
				  limit: 10,
				}
				this.getList(this.ids)
			},
			// 关闭按钮
			cancel() {
				this.formValidate = {
				 ids: '',
                 store_id: '',
                 keyword: "",
                 data: "",
                 page: 1,
                 limit: 10
               }
			}
        }
    }
